question:
ਤਿਕੋਣ $ABC$ ਸਮਦੋਸ਼ੀ ਹੈ, ਜਿਸ ਵਿੱਚ $AB=AC$ ਅਤੇ ਉਚਾਈ $AM=11$ ਹੈ। ਮੰਨ ਲਵੋ ਕਿ $\overline{AM}$ 'ਤੇ ਇੱਕ ਬਿੰਦੂ $D$ ਹੈ ਜਿਸ ਨਾਲ $AD=10$ ਹੈ ਅਤੇ $\angle BDC=3\angle BAC$ ਹੈ। ਤਿਕੋਣ $ABC$ ਦਾ ਪਰਿਮਾਪ ਲੱਭੋ।

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

original_question:
ਇੱਕ ਆਯਾਤਾਕਾਰ ਖੇਤਰ ਨੂੰ ਇੱਕ ਖੇਡ ਟਰੈਕ ਵਿੱਚ ਘੇਰਿਆ ਗਿਆ ਹੈ, ਜਿਵੇਂ ਕਿ ਹੇਠਾਂ ਦਿਖਾਇਆ ਗਿਆ ਹੈ। ਟਰੈਕ ਵਿੱਚ ਖੇਤਰ ਦੇ ਦੋ ਕਿਨਾਰੇ ਅਤੇ ਦੋ ਅਰਧਵ੍ਰਤ ਸ਼ਾਮਲ ਹਨ। ਟਰੈਕ ਦੀ ਲੰਬਾਈ 400 ਮੀਟਰ ਹੈ। ਖੇਤਰ ਦਾ ਸਭ ਤੋਂ ਵੱਡਾ ਸੰਭਾਵਿਤ ਖੇਤਰਫਲ ਕਿੰਨਾ ਹੋ ਸਕਦਾ ਹੈ, ਵਰਗ ਮੀਟਰ ਵਿੱਚ?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

