\begin{array}{cl}
3-x & \text{ ਜੇਕਰ } x \leq 3, \\
-x^3+2x^2+3x & \text{ ਜੇਕਰ } x>3.
\end{array}
\right.\] $f^{-1}(0)+f^{-1}(6)$ ਦੀ ਗਣਨਾ ਕਰੋ।

